<script>
			let regionLinks = document.querySelectorAll('.accordion-button')
			let mapAreas = document.querySelectorAll('.whlrMapContainer')
			let regionId
			console.log(`initial region ID is ${regionId}`)
			regionLinks.forEach((link) => {
				link.addEventListener('click', doIt)
			})
			function doIt() {
				event.preventDefault()
				regionId = event.target.id 
				console.log(`initial region ID is ${regionId}`)
				mapAreas.forEach((area) => {
					if (area.id === regionId) {
						area.classList.remove('hidden')
					} else {
						area.classList.add('hidden')
					}
				})
			}
</script>
